import React from 'react'
import ListGroup from 'react-bootstrap/ListGroup'

export default function SearchResult(props) {
    let {searched}=props;

    return (
        <div>
        <ListGroup as="ul">
          <li>{searched}</li>
        </ListGroup>
    </div>
    )
}
